webpackJsonp([0x758a9df3fff0],{8421:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"C64, Where Are You?",date:"16 Feb 2005",slug:"/2005-02-16-c64-where-are-you/",tags:"Y2005"},html:'<p>For the past 20 years a Commodore 64 was instrumental in displaying the departures and arrivals at the Dortmund train station. Now the C64 has died, the display has gone black, and the station has a big problem: a new display system would cost over 3 million Euros. (<a href="http://www.wdr.de/themen/computer/1/commodore64/">WDR</a>, via <a title="Industrial Technology & Witchcraft - das Weblog von TextLab" href="http://www.industrial-technology-and-witchcraft.de/index.php/ITW/13695/">Industrial Technology & Witchcraft</a>)</p>\n<p><strong>Update:</strong> Welcome visitors from <a href="http://forums.fark.com/cgi/fark/comments.pl?IDLink=1361548">fark.com</a>. Alas, it wasn\'t a C64 after all, as one of you <a href="http://www.papascott.de/archives/2005/02/16/c64-where-are-you/#c1837">points out in my comments</a> (see also <a href="http://www.heise.de/newsticker/meldung/56509">heise.de</a>), but an Intel 310 system with a 80286 processor. WDR has now corrected their story. ITW also <a href="http://www.industrial-technology-and-witchcraft.de/index.php/ITW/13706/">published the correction</a>, and also <a href="http://www.industrial-technology-and-witchcraft.de/index.php/ITW/13713/">links to video news clips</a> from WDR (in German, of course).</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2005/02/c64dortmund.jpg" vspace="10" border="0" alt="image" width="283" height="190" /><img src="http://www.papascott.de/wordpress/wp-content/uploads/2005/02/c64dortmund2.jpg" hspace="10" vspace="10" border="0" alt="image" width="253" height="190" /></p>'},next:{fields:{title:"SELECT * FROM error;",date:"15 Feb 2005",slug:"/2005-02-15-select-from-error/"}},previous:{fields:{title:"Keep Me Dumb, Please",date:"16 Feb 2005",slug:"/2005-02-16-keep-me-dumb-please/"}}},{node:{fields:{title:"SELECT * FROM error;",date:"15 Feb 2005",slug:"/2005-02-15-select-from-error/",tags:"Y2005"},html:"<p>I haven't seen this explicitly stated anywhere, but you probably don't want to run <a title=\"mysqlsnapshot\" href=\"http://jeremy.zawodny.com/mysql/mysqlsnapshot/\">mysqlsnapshot</a> on a database that is already an active master, since the script issues a RESET MASTER which will stop replication in its tracks. </p>\n<p>Another good hint for mysql is to make sure that the mysql user has write privileges in its data directory. That's such a basic mistake that you don't even think it could go wrong, but it can.</p>"},next:{fields:{title:"Schockwellenreiter RSS",date:"11 Feb 2005",slug:"/2005-02-11-schockwellenreiter-rss/"}},previous:{fields:{title:"C64, Where Are You?",date:"16 Feb 2005",slug:"/2005-02-16-c64-where-are-you/"}}},{node:{fields:{title:"Schockwellenreiter RSS",date:"11 Feb 2005",slug:"/2005-02-11-schockwellenreiter-rss/",tags:"Y2005"},html:'<p><a title="Der Schockwellenreiter: Weblog-Archiv 11.02.2005" href="http://www.schockwellenreiter.de/2005/02/11.html#derSchockwellenreiterHatWiederEinenRssfeed">The Schockwellenreiter has a new RSS feed</a>, in case you\'re like me and only read Bloglines and wondered where JÃ¶rg has been the past few days...</p>'},next:{fields:{title:"Dresden Connection",date:"11 Feb 2005",slug:"/2005-02-11-dresden-connection/"}},previous:{fields:{title:"SELECT * FROM error;",date:"15 Feb 2005",slug:"/2005-02-15-select-from-error/"}}}],pathPrefix:"",first:!1,last:!1,index:343,pageCount:1101}}}});
